import './App.css';
import { useState, useEffect} from "react";
import Axios from "axios"

function App() {
  const [listOfPatients, setListOfPatients] = useState ([]);

  useEffect(() => {
    Axios.get("http://localhost:3001/getPatients").then((response) => {
      setListOfPatients(response.data);
    });
  }, []);

  return (
    <div className="App">
      <div className = "patientsDisplay"> 
        {listOfPatients.map((patient) => {
          return (
            <div>
              <h1>Name: {patient.name}</h1>
              <h1>Gender: {patient.gender}</h1>
              <h1>Date of Birth: {patient.dob}</h1>
              <h1>Height: {patient.height}</h1>
              <h1>Weight: {patient.weight}</h1>
              <h1>Email: {patient.email}</h1>
              <h1>Medical History: {patient.medicalHistory}</h1>
            </div>
          );
        })}
      </div>

      <div>
        <input type = "text" placeholder = "Name" />
        <input type = "text" placeholder = "Gender" />
        <input type = "text" placeholder = "DOB" />
        <input type = "number" placeholder = "Height" />
        <input type = "number" placeholder = "Weight" />
        <input type = "text" placeholder = "Email" />
        <input type = "text" placeholder = "Medical History" />
      </div>
    </div>
  );
}

export default App;
